import React from 'react';
import './App.css';
import Cards from './Components/Cards';
import Navs from './Components/Navs';
import LeftNav from './Components/LeftNav';
import Banner from './Components/Banner';

function App() {
  return (
    <div className="App">
      <Navs />
      <div class="container">
        <div class="row">
          {/* <!-- Left Side --> */}
          <LeftNav />

          {/* <!-- Right Side --> */}
          <div class="col-lg-9">
            {/* Top right side */}
            <Banner />

            {/* Bottom right side */}
            <Cards />
          </div>
        </div>
        {/* <!-- /.col-lg-9 --> */}

      </div>
      {/* <!-- /.row --> */}

    </div>

  );
}

export default App;
